// src/pages/Profile.js
import React, { useState, useEffect } from "react";

const Profile = () => {
  // Assuming you have user data saved in localStorage or state
  const [userData, setUserData] = useState(null);

  useEffect(() => {
    // For now, let's mock the user data. Replace this with actual logic (API or state)
    const data = JSON.parse(localStorage.getItem("userData"));
    setUserData(data);
  }, []);

  if (!userData) {
    return <div>Loading...</div>;
  }

  return (
    <div className="min-h-screen bg-gray-100 pt-16">
      <div className="container mx-auto p-6 bg-white shadow-lg rounded-lg">
        <h1 className="text-3xl font-bold text-center mb-6">Profile</h1>
        <div className="space-y-4">
          <div>
            <strong className="text-xl">Full Name: </strong>
            <span>{userData.fullName}</span>
          </div>
          <div>
            <strong className="text-xl">Email: </strong>
            <span>{userData.email}</span>
          </div>
          <div>
            <strong className="text-xl">Phone: </strong>
            <span>{userData.phone}</span>
          </div>
          <div>
            <strong className="text-xl">Location: </strong>
            <span>{userData.location}</span>
          </div>
          <div>
            <strong className="text-xl">Gender: </strong>
            <span>{userData.gender}</span>
          </div>
          <div>
            <strong className="text-xl">Skills: </strong>
            <span>{userData.skills}</span>
          </div>
          <div>
            <strong className="text-xl">Profile Picture: </strong>
            <img
              src={userData.profilePicture || "/default-profile.png"}
              alt="Profile"
              className="w-24 h-24 rounded-full"
            />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Profile;
